267ad73e638a85666fd849ba69c892326055d6a7:
query BetsPlaced($where: BetPlaced_filter) {
  betPlaceds(where: $where) {
    gameId
    bettor
    number
    value
    timestamp
    betId
    blockNumber
    blockTimestamp
    transactionHash
  }
}

